export class KlingonArmorUniformPack extends BaseKlingonUniformPack implements IUniformPack {

    getRankIndicator(token: Token) {
        let borderRank = this.getRankBorderIndicator(token);
        if (token.bodyType === BodyType.AverageMale) {
            return `<g transform="matrix(0.23133638,0.01820657,0,0.23134511,227.66287,170.48374)">`
                    + borderRank +
                `</g>
<g transform="matrix(0.09227919,-0.00604831,0,0.21724297,268.77182,176.95177)">`
                    + borderRank +
            `</g>`;
        } else {
            return `<g transform="matrix(0.27326447,0.02684523,-0.0370136,0.26993717,215.0807,151.83316)">`
                    + borderRank +
                `</g>
<g transform="matrix(0.10916856,-0.08025211,0.10512724,0.21861227,238.49637,180.18806)">`
                    + borderRank +
            `</g>`;
        }
    }

    getUniformSwatches() {
        return [
            new Swatch(BodyType.AverageMale, "Average Male", (token) => UniformCatalog.decorateSwatch(
                this.getNeck(BodyType.AverageMale, token.skinColor, undefined, UniformEra.Klingon, UniformVariantType.Base)
                + KlingonArmour.averageMaleBody, BodyType.AverageMale, token), "BodyType.averageMale"),
            new Swatch(BodyType.AverageFemale, "Average Female", (token) => UniformCatalog.decorateSwatch(
                this.getNeck(BodyType.AverageFemale, token.skinColor, undefined, UniformEra.Klingon, UniformVariantType.Base)
                + KlingonArmour.averageFemaleBody, BodyType.AverageFemale, token), "BodyType.averageFemale"),
        ];
    }

    protected getNeck(body: BodyType, skinColor: string, species?: Species, uniformEra?: UniformEra, uniformVariant?: UniformVariantType): string {
        let result = super.getNeck(body, skinColor, species, uniformEra, uniformVariant);

        if (body === BodyType.AverageFemale) {
            result += KlingonArmour.femaleChest;
        }

        return result;
    }

    getUniformAndVariantBody(token: Token) {
        let result = "";
            let seam = "";
            let neck = "";
                switch (token.bodyType) {
                case BodyType.AverageMale:
                    neck = this.getNeck(BodyType.AverageMale, token.skinColor, undefined, UniformEra.Klingon, UniformVariantType.Base)
                    result = KlingonArmour.averageMaleBody;
                    if (token.variant === UniformVariantType.Variant1) {
                        result += KlingonArmour.klingonSash;
                    }
                    break;
                case BodyType.AverageFemale:
                default:
                    neck = this.getNeck(BodyType.AverageFemale, token.skinColor, undefined, UniformEra.Klingon, UniformVariantType.Base)
                    result = KlingonArmour.averageFemaleBody;
            }

            return (neck + result + seam).replace(DefaultRed, token.divisionColor).replace(SpeciesRestrictions.DEFAULT_SKIN_COLOR_REGEX, token.skinColor);
    }

    getUniformVariantSwatches(token: Token) {
        if (token.bodyType === BodyType.AverageMale && token.rankIndicator === Rank.Captain) {
            return [
                new Swatch(UniformVariantType.Base, "Standard Armour", (token) => UniformCatalog.decorateSwatch(
                    this.getNeck(BodyType.AverageMale, token.skinColor, undefined, UniformEra.Klingon, UniformVariantType.Base)
                    + KlingonArmour.averageMaleBody, BodyType.AverageMale, token)),
                new Swatch(UniformVariantType.Variant1, "Standard Armour with Sash", (token) => UniformCatalog.decorateSwatch(
                    this.getNeck(BodyType.AverageFemale, token.skinColor, undefined, UniformEra.Klingon, UniformVariantType.Variant1)
                    + KlingonArmour.averageMaleBody + KlingonArmour.klingonSash, BodyType.AverageMale, token)),
            ];
        } else {
            return [];
        }
    }
}